INSERT INTO `ecs_comment` ( `comment_id`, `comment_type`, `id_value`, `email`, `user_name`, `content`, `comment_rank`, `add_time`, `ip_address`, `status`, `parent_id`, `user_id` ) VALUES  ('15', '0', '49', 'belladndy82@126.com', '', '昨天晚上八九点订的货，今天一大早就送到了，速度非常快，快递员的态度非常的好，不像淘宝网那些其他快递公司的人员，京东的非常有素质从订货到发货再到完成订单，整个流程清晰可见，非常满意！', '5', '1278065332', '127.0.0.1', '1', '0', '0');
INSERT INTO `ecs_comment` ( `comment_id`, `comment_type`, `id_value`, `email`, `user_name`, `content`, `comment_rank`, `add_time`, `ip_address`, `status`, `parent_id`, `user_id` ) VALUES  ('16', '0', '50', 'b@1123.com', '', '一直都想买个双肩包，一直因为没有啥出行计划耽搁着。昨天无意间看见令牌专场力开力朗的双肩背包只要50，立马拿下！包包样式不错，休闲运动款，我和我男朋友都能背，包里面隔层还算多，尤其是里面有层刚好可以放下我１４寸的本本，这一点另我尤其满意，背带设计也蛮舒服的，惟独另我觉得不足是面料不是太厚实，特别是里面隔层面料很薄。总之，５０多块钱还是蛮划算的啦，平常不背太重的东西的话，这个就够用啦！', '5', '1278065832', '127.0.0.1', '1', '0', '0');
INSERT INTO `ecs_comment` ( `comment_id`, `comment_type`, `id_value`, `email`, `user_name`, `content`, `comment_rank`, `add_time`, `ip_address`, `status`, `parent_id`, `user_id` ) VALUES  ('14', '0', '48', '111@126.com', '', '相机大套， 不错，还需要摸索着用，买回来第二天老公特意去了百脑汇，把组件全配了，1、遮光罩（防的）—50元；2、品胜的电池—80元；3、UV镜（肯高多层）—100元；4、SanDisk Extreme 16G SDHC卡(class10)30MB/S ——630元；5、相机包—140元；6、金刚gcs的玻璃屏幕罩——120元（有这个就不用贴膜了，连同上面的小窗口一起保护起来了），配件总共花了1120元，相机全副武装完毕。', '5', '1278061266', '127.0.0.1', '1', '0', '0');
