INSERT INTO `ecs_comment` ( `comment_id`, `comment_type`, `id_value`, `email`, `user_name`, `content`, `comment_rank`, `add_time`, `ip_address`, `status`, `parent_id`, `user_id` ) VALUES  ('23', '0', '134', '111111@qq.com', '', '外观漂亮，使用便捷，音质也很好,体积小！携带方便！', '5', '1364847612', '127.0.0.1', '1', '0', '0');
INSERT INTO `ecs_comment` ( `comment_id`, `comment_type`, `id_value`, `email`, `user_name`, `content`, `comment_rank`, `add_time`, `ip_address`, `status`, `parent_id`, `user_id` ) VALUES  ('21', '0', '130', '11@12311114.com', '', '12月22日大早就守在京东，终于抢到一台,还送1眼镜，比苏宁易购等其他地方便宜了1000元以上，今天', '5', '1332710448', '127.0.0.1', '1', '0', '0');
