当场反馈您预定成功的信息,邮件预约：您也可以提前2天发送邮件进行预约，邮箱：55tuan@idobread.com，邮件格式如下，通过邮件预订成功后店家会在24小时内给您回信反馈。<span style=\"color: rgb(255, 0, 0);\">总机电话：021-54259315（请拨打总机，各分店不接受电话预约）</span></div>\r\n<div style=\"margin: 0px; padding: 0px; vertical-align: baseline; font-family: tahoma, arial, 宋体; line-height: 18px;\">● 营业时间：11:00-19:00，节假日均可提货，请尽量避开高峰时段</div>\r\n<div style=\"margin: 0px; padding: 0px; vertical-align: baseline; font-family: tahoma, arial, 宋体; line-height: 18px;\">● 每盒蛋糕均配刀叉，更有精美礼盒包装，送给亲朋好友的好选择哦</div>\r\n<div style=\"margin: 0px; padding: 0px; vertical-align: baseline; font-family: tahoma, arial, 宋体; line-height: 18px;\">● 蛋糕需3天以内食用完毕，要尽早享用美味哦</div>\r\n<div style=\"margin: 0px; padding: 0px; vertical-align: baseline; font-family: tahoma, arial, 宋体; line-height: 18px;\">● 不可与店内其他优惠同时进行</div>\r\n<div style=\"margin: 0px; padding: 0px; vertical-align: baseline; font-family: tahoma, arial, 宋体; line-height: 18px;\">● 请妥善保管您的优惠券序列号及密码，在消费时出示优惠券信息</div>\r\n<div style=\"margin: 0px; padding: 0px; vertical-align: baseline; font-family: tahoma, arial, 宋体; line-height: 18px;\">● 优惠券不兑现金，不设找零</div>\r\n<div style=\"margin: 0px; padding: 0px; vertical-align: baseline; font-family: tahoma, arial, 宋体; line-height: 18px;\">\r\n<p style=\"margin: 0px; padding: 3px 6px; vertical-align: baseline; background-color: rgb(255, 128, 0); color: rgb(255, 255, 255); border-top-left-radius: 3px; border-top-right-radius: 3px; border-bottom-right-radius: 3px; border-bottom-left-radius: 3px;\"><b>香甜丝滑，幸福在流淌！</b></p>\r\n</div>\r\n<div style=\"margin: 0px; padding: 0px; vertical-align: baseline; font-family: tahoma, arial, 宋体; line-height: 18px;\">\r\n<div style=\"margin: 0px; padding: 0px; vertical-align: baseline;\">宇治抹茶慕斯</div>\r\n<div style=\"margin: 0px; padding: 0px; vertical-align: baseline;\">爱度臻选日本顶级宇治抹茶制成入口即溶的宇治抹茶慕斯，甜蜜和苦涩的味蕾共同绽放，这是一场平淡的相爱，这是永不凋谢的情结，他所散发出淡淡的茶香，让我们不禁联想到，在绿玉葱葱的茶园里，辛勤耕种的日本静冈茶农，远望着对面白雪皑皑的富士山。爱度宇治抹茶慕斯，平淡之中见真味。<br />\r\n<img src=\"http://image4.suning.cn/vgsimages/groupbuy/0000/00000000/000000009840/000000009840_d_1.jpg\" style=\"border: 0px; vertical-align: middle; background-image: url(http://tuan.suning.com/hoteltuan-web/RES/groupbuy/css/images/blankbg.gif); background-color: rgb(238, 238, 238); margin-bottom: 10px; background-position: 50% 50%; background-repeat: no-repeat no-repeat;\" alt=\"\" /><br />\r\n<br />\r\n<img src=\"http://image4.suning.cn/vgsimages/groupbuy/0000/00000000/000000009840/000000009840_d_2.jpg\" style=\"border: 0px; vertical-align: middle; background-image: url(http://tuan.suning.com/hoteltuan-web/RES/groupbuy/css/images/blankbg.gif); background-color: rgb(238, 238, 238); margin-bottom: 10px; background-position: 50% 50%; background-repeat: no-repeat no-repeat;\" alt=\"\" /><br />\r\n&nbsp;</div>\r\n<div style=\"margin: 0px; padding: 0px; vertical-align: baseline;\"><img alt=\"\" src=\"http://image4.suning.cn/vgsimages/groupbuy/0000/00000000/000000009840/000000009840_d_3.jpg\" style=\"border: 0px; vertical-align: middle; background-image: url(http://tuan.suning.com/hoteltuan-web/RES/groupbuy/css/images/blankbg.gif); background-color: rgb(238, 238, 238); margin-bottom: 10px; background-position: 50% 50%; background-repeat: no-repeat no-repeat;\" /></div>\r\n<div style=\"margin: 0px; padding: 0px; vertical-align: baseline;\">提拉米苏</div>\r\n<div style=\"margin: 0px; padding: 0px; vertical-align: baseline;\">爱度采用纯正法国进口铁塔奶油芝士、意大利咖啡、荷兰可可粉作为原料，调合法国鲜奶，冰冻24小时制成经典的提拉米苏蛋糕。它以香醇浓沉的口感，将咖啡的苦、奶油的稠香糅合在一起，把美味演绎到极致。Tiramisu在意大利文里是&ldquo;带我走&rdquo;的意思，爱度的提拉米苏蛋糕带走的可不只是美味哦，还有爱和幸福。一勺入口，满口清香，入口即化，芝士的香醇混合了咖啡的苦涩，再加上奶油的甜腻粘滑，充满冰淇淋的味道，满口都是甜蜜的滋味。<br />\r\n<img alt=\"\" src=\"http://image4.suning.cn/vgsimages/groupbuy/0000/00000000/000000009840/000000009840_d_4.jpg\" style=\"border: 0px; vertical-align: middle; background-image: url(http://tuan.suning.com/hoteltuan-web/RES/groupbuy/css/images/blankbg.gif); background-color: rgb(238, 238, 238); margin-bottom: 10px; background-position: 50% 50%; background-repeat: no-repeat no-repeat;\" /><br />\r\n<br />\r\n<img src=\"http://image4.suning.cn/vgsimages/groupbuy/0000/00000000/000000009840/000000009840_d_5.jpg\" style=\"border: 0px; vertical-align: middle; background-image: url(http://tuan.suning.com/hoteltuan-web/RES/groupbuy/css/images/blankbg.gif); background-color: rgb(238, 238, 238); margin-bottom: 10px; background-position: 50% 50%; background-repeat: no-repeat no-repeat;\" alt=\"\" /><br />\r\n&nbsp;</div>\r\n<div style=\"margin: 0px; padding: 0px; vertical-align: baseline;\"><img src=\"http://image4.suning.cn/vgsimages/groupbuy/0000/00000000/000000009840/000000009840_d_6.jpg\" style=\"border: 0px; vertical-align: middle; background-image: url(http://tuan.suning.com/hoteltuan-web/RES/groupbuy/css/images/blankbg.gif); background-color: rgb(238, 238, 238); margin-bottom: 10px; background-position: 50% 50%; background-repeat: no-repeat no-repeat;\" alt=\"\" /></div>\r\n<div style=\"margin: 0px; padding: 0px; vertical-align: baseline;\">草莓提拉慕斯</div>\r\n<div style=\"margin: 0px; padding: 0px; vertical-align: baseline;\">季节限定，让您一次享受两种美味，上层草莓慕斯，只在草莓季限定提供，新鲜草莓泥调和法国鲜奶制作而成，下层是爱度一贯的明星产品提拉米苏，最后在表面撒上诱人的白巧克力并用草莓酱点缀，双重滋味，层层叠叠的完美口感，是初春最不能错过的小清新蛋糕哦。切一小块蛋糕，轻轻放入口里，让舌尖去感受这一刻的美好。酸酸甜甜的口感，绵软清香，在口中与唇舌碰撞出愉悦的音符，让人回味无穷。</div>\r\n<div style=\"margin: 0px; padding: 0px; vertical-align: baseline;\"><img src=\"http://image4.suning.cn/vgsimages/groupbuy/0000/00000000/000000009840/000000009840_d_7.jpg\" style=\"border: 0px; vertical-align: middle; background-image: url(http://tuan.suning.com/hoteltuan-web/RES/groupbuy/css/images/blankbg.gif); background-color: rgb(238, 238, 238); margin-bottom: 10px; background-position: 50% 50%; background-repeat: no-repeat no-repeat;\" alt=\"\" /><br />\r\n<br />\r\n<img alt=\"\" src=\"http://image4.suning.cn/vgsimages/groupbuy/0000/00000000/000000009840/000000009840_d_8.jpg\" style=\"border: 0px; vertical-align: middle; background-image: url(http://tuan.suning.com/hoteltuan-web/RES/groupbuy/css/images/blankbg.gif); background-color: rgb(238, 238, 238); margin-bottom: 10px; background-position: 50% 50%; background-repeat: no-repeat no-repeat;\" /><br />\r\n<br />\r\n<img src=\"http://image4.suning.cn/vgsimages/groupbuy/0000/00000000/000000009840/000000009840_d_9.jpg\" style=\"border: 0px; vertical-align: middle; background-image: url(http://tuan.suning.com/hoteltuan-web/RES/groupbuy/css/images/blankbg.gif); background-color: rgb(238, 238, 238); margin-bottom: 10px; background-position: 50% 50%; background-repeat: no-repeat no-repeat;\" alt=\"\" /></div>\r\n<div style=\"margin: 0px; padding: 0px; vertical-align: baseline;\">至尊巧克力慕斯</div>\r\n<div style=\"margin: 0px; padding: 0px; vertical-align: baseline;\">采用意大利马天尼巧克力融合法国鲜奶制作而成。巧克力一直以来都是西点里的宠儿，一道平凡的西点，有了它，立刻就会变得口味不凡。有别于一般的巧克力慕斯蛋糕，爱度为您呈现与众不同的巧克力慕斯蛋糕风情。尊重传统蛋糕制作工艺，口口丝滑，美味非比寻常，表面再撒上顶级巧克力碎，口味层层叠叠，如冰淇淋一般入口即化，同时低脂健康，是视觉与味觉的一场盛宴，千万别错过哦。<br />\r\n<img src=\"http://image4.suning.cn/vgsimages/groupbuy/0000/00000000/000000009840/000000009840_d_10.jpg\" style=\"border: 0px; vertical-align: middle; background-image: url(http://tuan.suning.com/hoteltuan-web/RES/groupbuy/css/images/blankbg.gif); background-color: rgb(238, 238, 238); margin-bottom: 10px; background-position: 50% 50%; background-repeat: no-repeat no-repeat;\" alt=\"\" /><br />\r\n<br />\r\n<img src=\"http://image4.suning.cn/vgsimages/groupbuy/0000/00000000/000000009840/000000009840_d_11.jpg\" style=\"border: 0px; vertical-align: middle; background-image: url(http://tuan.suning.com/hoteltuan-web/RES/groupbuy/css/images/blankbg.gif); background-color: rgb(238, 238, 238); margin-bottom: 10px; background-position: 50% 50%; background-repeat: no-repeat no-repeat;\" alt=\"\" /><br />\r\n&nbsp;</div>\r\n</div>\r\n<div style=\"margin: 0px; padding: 0px; vertical-align: baseline; font-family: tahoma, arial, 宋体; line-height: 18px;\">\r\n<p style=\"margin: 0px; padding: 3px 6px; vertical-align: baseline; background-color: rgb(255, 128, 0); color: rgb(255, 255, 255); border-top-left-radius: 3px; border-top-right-radius: 3px; border-bottom-right-radius: 3px; border-bottom-left-radius: 3px;\"><b>爱&middot;度蛋糕，即刻分享甜蜜</b></p>\r\n</div>\r\n<div style=\"margin: 0px; padding: 0px; vertical-align: baseline; font-family: tahoma, arial, 宋体; line-height: 18px;\">I do是来自澳洲的烘焙品牌，主要经营正宗上品法式面包、新鲜三明治、欧式蛋糕、纯正咖啡、冰激凌等。&ldquo;爱度&rdquo;网罗全球精选食材，让顾客能够真正享用到由顶尖原料精心制作的蛋糕。爱度的所有烘焙产品都是现做现售的，&ldquo;现做现售&rdquo;的经营理念能够让顾客真正的体验&ldquo;新鲜&rdquo;面包的含义。喜欢甜蜜的你，期待与爱度的浪漫邂逅吗？</div>\r\n<div style=\"margin: 0px; padding: 0px; vertical-align: baseline; font-family: tahoma, arial, 宋体; line-height: 18px;\"><img alt=\"\" src=\"http://image4.suning.cn/vgsimages/groupbuy/0000/00000000/000000009840/000000009840_d_12.jpg\" style=\"border: 0px; vertical-align: middle; background-image: url(http://tuan.suning.com/hoteltuan-web/RES/groupbuy/css/images/blankbg.gif); background-color: rgb(238, 238, 238); margin-bottom: 10px; width: 480px; height: 270px; background-position: 50% 50%; background-repeat: no-repeat no-repeat;\" /></div>\r\n<div style=\"margin: 0px; padding: 0px; vertical-align: baseline; font-family: tahoma, arial, 宋体; line-height: 18px;\">&nbsp;</div>\r\n<div style=\"margin: 0px; padding: 0px; vertical-align: baseline; font-family: tahoma, arial, 宋体; line-height: 18px;\"><img alt=\"\" src=\"http://image4.suning.cn/vgsimages/groupbuy/0000/00000000/000000009840/000000009840_d_13.jpg\" style=\"border: 0px; vertical-align: middle; background-image: url(http://tuan.suning.com/hoteltuan-web/RES/groupbuy/css/images/blankbg.gif); background-color: rgb(238, 238, 238); margin-bottom: 10px; width: 480px; height: 361px; background-position: 50% 50%; background-repeat: no-repeat no-repeat;\" /></div>\r\n<div style=\"margin: 0px; padding: 0px; vertical-align: baseline; font-family: tahoma, arial, 宋体; line-height: 18px;\">&nbsp;</div>\r\n<div style=\"margin: 0px; padding: 0px; vertical-align: baseline; font-family: tahoma, arial, 宋体; line-height: 18px;\"><img alt=\"\" src=\"http://image4.suning.cn/vgsimages/groupbuy/0000/00000000/000000009840/0